import React from "react";
import { Switch, Route } from 'react-router-dom';
import { Box, Container, AppBar, Toolbar, Typography, IconButton } from "@material-ui/core";
import MenuIcon from "@material-ui/icons/Menu";
import { useTheme } from "@material-ui/core/styles";
import useMediaQuery from "@material-ui/core/useMediaQuery";
import DesktopMenu from "./DesktopMenu";
import MobileMenu from "./MobileMenu";
import Home from "../pages/Home";
import About from "../pages/About";
import BeautifulPlaces from "../pages/BeautifulPlaces";
import OpenAI from "../pages/OpenAI";
import SignUp from "../pages/SignUp";

function Navbar() {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm"));
  const [isDrawerOpen, setIsDrawerOpen] = React.useState(false);
  const [isLoggedIn, setIsLoggedIn] = React.useState(false);

  const handleDrawerToggle = () => {
    setIsDrawerOpen(!isDrawerOpen);
  };

  const handleLogIn = () => {
    setIsLoggedIn(true);
  };

  const handleLogOut = () => {
    setIsLoggedIn(false);
  };

  return (
    <>
      <AppBar position="fixed">
        <Container fixed>
          <Toolbar>
            {isMobile ? (
              <>
                <IconButton edge="start" color="inherit" aria-label="menu" onClick={handleDrawerToggle}>
                  <MenuIcon />
                </IconButton>
                <Typography variant="h6">Nomad's Odyssey</Typography>
              </>
            ) : (
              <>
                <Typography variant="h6" sx={{ mr: 3 }}>Nomad's Odyssey</Typography>
                <DesktopMenu />
              </>
            )}
            <Box sx={{ flexGrow: 1 }} />
          </Toolbar>
        </Container>
      </AppBar>
      {isMobile && (
        <MobileMenu isOpen={isDrawerOpen} handleDrawerToggle={handleDrawerToggle} handleLogIn={handleLogIn} handleLogOut={handleLogOut} isLoggedIn={isLoggedIn} />
      )}
      {!isMobile && (
        <Box sx={{ paddingTop: 12 }}>
          <Container fixed>
            <Switch>
              <Route exact path="/">
                <Home />
              </Route>
              <Route path="/about">
                <About />
              </Route>
              <Route path="/beautifulplaces">
                <BeautifulPlaces />
              </Route>
              <Route path="/openai">
                <OpenAI />
              </Route>
              <Route path="/signup">
                <SignUp />
              </Route>
            </Switch>
          </Container>
        </Box>
      )}
    </>
  );
}

export default Navbar;
